let postsData = [
    {name: 'Evgeniy', text: 'I need more React', like:'16'},
    {text: 'I love REACT!!!', like:'45'}
]


let dialogsData = [
    {id: 1, name: "Dimych",},
    {id: 2, name: "Evgeniy",},
    {id: 3, name: "Sasha",},
]

let messagesData = [
    {id: 1, message: "Hello",},
    {id: 2, message: "How are you?",},
    {id: 3, message: "Chel",},
]

let state = {
    postsData: [
        {name: 'Evgeniy', text: 'I need more React', like:'16'},
        {text: 'I love REACT!!!', like:'45'}
    ],
    dialogsData: [
        {id: 1, name: "Dimych",},
        {id: 2, name: "Evgeniy",},
        {id: 3, name: "Sasha",},
    ],
    messagesData: [
        {id: 1, message: "Hello",},
        {id: 2, message: "How are you?",},
        {id: 3, message: "Chel",},
    ]
};

export default state;
